import React from "react";
import {Modal} from 'antd';

import "../dashboard.css";


 function Assetimage ({openModal, onModalClose, row}){
    console.log("row", row);
    return (
        <Modal
        open={openModal}
        title="Asset Details"
        // onOk={handleOk}
        onCancel={onModalClose}

        >
            <div>
                <p> Department: {row?.name}</p>
                <p>{row?.model}</p>
                <p>{row?.os}</p>
                <p>{row?.serial_no}</p>
            </div>

      </Modal>
    );

};
export default Assetimage;
